import React from "react";
import { Login, ForgotPassword, ResetPassword } from "@pages/auth";
import Dasboard from "@pages/dasboard";
import ManagerUser from "@pages/manager/user";
import AccountManagement from "@pages/manager/account";
import Account from "@pages/manager/account/Account";
import AccountForm from "@pages/manager/account/AccountForm";

import ManagementAdmin from "@pages/manager/admin";
import AdminForm from "@pages/manager/admin/AdminForm";
import AdminDetail from "@pages/manager/admin/AdminDetail";

import UserList from "@pages/manager/user/UserList";
import UserForm from "@pages/manager/user/UserForm";
import UserOtp from "@pages/manager/user/UserOtp";
import UserDetail from "@pages/manager/user/UserDetail";

import PostManagement from "@pages/posts";
import EventManagement from "@pages/manager/event";
import EventList from "@pages/manager/event/EventList";
import EventForm from "@pages/manager/event/EventForm";
import EventUserJoin from "@pages/manager/event/EventUserJoin";
import EventDetail from "@pages/manager/event/EventDetail";

import CourseManagement from "@pages/manager/course";
import CourseList from "@pages/manager/course/CourseList";
import CourseForm from "@pages/manager/course/CourseForm";
import PostList from "@pages/posts/PostList";
import PostForm from "@pages/posts/PostForm";

import CheckPointManagement from "@pages/checkpoint";
import CheckPointList from "@pages/checkpoint/CheckPointList";
import CheckPointForm from "@pages/checkpoint/CheckPointForm";
import Detail from "@pages/checkpoint/CheckPointDetail";
import CollectionManagement from "@pages/manager/collection";
import CollectionList from "@pages/manager/collection/CollectionList";
import CollectionForm from "@pages/manager/collection/CollectionForm";

import NotificationManagement from "@pages/notification";
import NotificationList from "@pages/notification/NotificationList";
import NotificationForm from "@pages/notification/NotificationForm";
import NotiDetailData from "@pages/notification/NotificationDetail";

import GiftCodeManagement from "@pages/manager/giftcode";
import GiftCodeList from "@pages/manager/giftcode/GiftCodeList";
import GiftCodeForm from "@pages/manager/giftcode/GiftCodeForm";
import GiftCodeDetail from "@pages/manager/giftcode/GiftCodeDetail";

import CollectionDetail from "@pages/manager/collection/CollectionDetail";
import CourseDetail from "@pages/manager/course/CourseDetail";

import BadgeManagement from "@pages/manager/badge";
import BadgeList from "@pages/manager/badge/BadgeList";
import BadgeForm from "@pages/manager/badge/BadgeForm";
import BadgeDetail from "@pages/manager/badge/BadgeDetail";

import MailManagerment from "@pages/manager/mail";
import MailList from "@pages/manager/mail/MailList";
import MailForm from "@pages/manager/mail/MailForm";
import MailDetail from "@pages/manager/mail/MailDetail";

import DataManagement from "@pages/manager/data";
import DataList from "@pages/manager/data/DataList";
import DataForm from "@pages/manager/data/DataForm";

import VersionManagement from "@pages/manager/version";
import VersionList from "@pages/manager/version/VersionList";
import VersionForm from "@pages/manager/version/VersionForm";

import GroupManagement from "@pages/manager/group";
import GroupList from "@pages/manager/group/GroupList";
import GroupForm from "@pages/manager/group/GroupForm";

import UserTagManagement from "@pages/manager/usertag";
import UserTagList from "@pages/manager/usertag/UserTagList";
import UserTagForm from "@pages/manager/usertag/UserTagForm";

import ResultImageManagement from "@pages/manager/result-image";
import ResultImageForm from "@pages/manager/result-image/ResultImageForm";
import ResultImageList from "@pages/manager/result-image/ResultImageList";

import LevelManagement from "@pages/manager/level";
import LevelList from "@pages/manager/level/LevelList";
import LevelForm from "@pages/manager/level/LevelForm";

import PATH_URL from "./pathURL";

const AdminList = React.lazy(() => import("@pages/manager/admin/AdminList"));

const routes = [
  {
    key: 1,
    path: PATH_URL.LOGIN,
    element: <Login />,
  },
  {
    key: 9,
    path: PATH_URL.FORGOT_PASSWORD,
    element: <ForgotPassword />,
  },
  {
    key: 10,
    path: PATH_URL.RESET_PASSWORD,
    element: <ResetPassword />,
  },
  {
    key: 2,
    path: PATH_URL.DASHBOARD,
    element: <Dasboard />,
    isLayout: true,
  },
  {
    key: 3,
    path: PATH_URL.MANAGER_USER.INDEX,
    element: <ManagerUser />,
    isLayout: true,
    children: [
      {
        key: 1,
        path: PATH_URL.MANAGER_USER.TABLE,
        element: <UserList />,
        isLayout: true,
      },
      {
        key: 2,
        path: PATH_URL.MANAGER_USER.CREATE,
        element: <UserForm />,
        isLayout: true,
      },
      {
        key: 3,
        path: PATH_URL.MANAGER_USER.EDIT,
        element: <UserForm />,
        isLayout: true,
      },
      {
        key: 4,
        path: PATH_URL.MANAGER_USER.DETAIL,
        element: <UserDetail />,
        isLayout: true,
      },
      {
        key: 5,
        path: PATH_URL.MANAGER_USER.OTP,
        element: <UserOtp />,
        isLayout: true,
      },
    ],
  },
  {
    key: 4,
    path: PATH_URL.MANAGER_ADMIN.INDEX,
    element: <ManagementAdmin />,
    isLayout: true,
    children: [
      {
        key: 1,
        path: PATH_URL.MANAGER_ADMIN.TABLE,
        element: <AdminList />,
        isLayout: true,
      },
      {
        key: 2,
        path: PATH_URL.MANAGER_ADMIN.CREATE,
        element: <AdminForm />,
        isLayout: true,
      },
      {
        key: 3,
        path: PATH_URL.MANAGER_ADMIN.EDIT,
        element: <AdminForm />,
        isLayout: true,
      },
      {
        key: 4,
        path: PATH_URL.MANAGER_ADMIN.DETAIL,
        element: <AdminDetail />,
